import "./App.css";
import SingleCell from "./components/SingleCell";
import CreateReservation from "./components/CreateReservation";
import CancelReservation from "./components/CancelReservation";
import { useState, useEffect, useRef } from "react";
import SingleCard from "./components/SingleCard";

import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  const [cars, setCars] = useState([]);
  const inModel = useRef();
  const inColor = useRef();
  const inYear = useRef();

  const inModelFilter = useRef();
  const inColorFilter = useRef();

  function action() {
    const object = {
      model: inModel.current.value,
      color: inColor.current.value,
      year: inYear.current.value,
    };

    const options = {
      method: "POST",
      headers: {
        "content-type": "application/json",
      },
      body: JSON.stringify(object),
    };

    fetch("http://localhost:4000/addCar/", options)
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
      });
  }

  function filter() {
    const fileterObj = {
      model: inModelFilter.current.value,
      color: inColorFilter.current.value,
    };
    fetch("http://localhost:4000/filterCar")
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
      });
  }

  return (
    <div className="App d-flex flex-column">
      <div className="App d-flex">
        <h1>ADD</h1>
        <input ref={inModel} type="text" placeholder="carmodel" />
        <input ref={inColor} type="text" placeholder="carcolor" />
        <input ref={inYear} type="text" placeholder="car Year" />
        <button onClick={action}>add</button>
      </div>
      <div className="App d-flex">
        <h1>FILTER</h1>
        <input ref={inModelFilter} type="text" placeholder="carmodel" />
        <input ref={inColorFilter} type="text" placeholder="carcolor" />

        <button onClick={filter}>add</button>
      </div>
      <div>
        {cars.map((x, i) => (
          <SingleCard item={x} key={x._id} />
        ))}
      </div>
    </div>
  );
}

export default App;
